  [],\n\t\"revision_timestamp\": \"2015-09-27T02:19:08.242973\",\n\t\"name\": \"ow-aviso-sea-surface-height-niiler-climatology\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset contains satellite-derived
  sea-surface height measurements collected by means of the TOPEX/Poseidon/ERS, JASON-1/Envisat,
  and Jason-2/Envisat satellite sensors. The data is collected twice a week, and is
  available at weekly and monthly intervals at a spatial resolution of approximately
  0.25 degrees. The geographic coverage is global, and the temporal coverage ranges
  from 1992-present. The data is combined with a Niiler Climatology (Niiler et al.,
  1994) and geostrophic currents (u and v components) are mathematically derived.\",\n\t\"license_title\":
